import React from "react";
import Navigation from "../components/Navigation";

const Acceuil = () => {
  return (
    <div className="container">
      <div>
        <h4 className="text-uppercase text-center display-5 fw-bolder">
          MOUNTAIN <br />
          <span className="p-5">biking</span>
        </h4>
        <Navigation />
        <div>
          <h2 className="text-uppercase text-light">
            What makes mountain <br />
            biking different?
          </h2>
          <p>
            Lorem, ipsum dolor sit amet consectetur adipisicing elit. Sint
            mollitia consequuntur veniam? Voluptatem ipsam consequuntur
            consequatur, sed perspiciatis repellat maiores. Voluptatum, iste
            quisquam distinctio ducimus tempore non inventore rem similique
            quasi quos sed, in hic nesciunt aspernatur recusandae nihil illum?
          </p>
        </div>
      </div>
    </div>
  );
};

export default Acceuil;
